import * as React from 'react';
import Icon from "@ant-design/icons/lib";
import styled from "styled-components";

const tuple = <T extends string[]>(...args: T) => args;

const ButtonTypes = tuple('default', 'primary', 'ghost', 'dashed', 'link', 'text');
export type ButtonType = typeof ButtonTypes[number];

const ButtonShapes = tuple('circle', 'circle-outline', 'round');
export type ButtonShape = typeof ButtonShapes[number];

const SizeTypes = tuple('small', 'middle', 'large');
export type SizeType = typeof SizeTypes[number];

export interface ButtonProps {
    type?: ButtonType;
    icon?: React.ReactNode;
    shape?: ButtonShape;
    size?: SizeType;
    loading?: boolean | { delay?: number };
    prefixCls?: string;
    className?: string;
    ghost?: boolean;
    danger?: boolean;
    block?: boolean;
    children?: React.ReactNode;
}

interface CompoundedComponent
    extends React.ForwardRefExoticComponent<ButtonProps & React.RefAttributes<HTMLElement>> {}


const InternalIcon: React.ForwardRefRenderFunction<unknown, ButtonProps> = (props, ref) => {
    const {
        loading,
        prefixCls: customizePrefixCls,
        type,
        danger,
        shape,
        size: customizeSize,
        className,
        children,
        icon,
        ghost,
        block,
        ...rest
    } = props;

    const styledNXIcon = (props: any) => <Icon component={props.icon} className='NXIcon' {...props} />

    const NXIcon = styled(styledNXIcon)`
    height: auto;
    width: ${(props: any) => (props.small ? "8px" : props.big ? "24px" : "16px")};
    cursor: pointer;
    margin: ${(props: any) => (props.margin ? `${props.margin}` : "auto 3px")};

    svg path{
    fill: ${(props: any)=> (props.fill ? props.fill : '')} !important;
    }

    svg rect{
    fill: ${(props: any)=> (props.fill ? props.fill : '')} !important;
    }
`;
    // const buttonNode = <button color={'red'}>
    //     'hi test button'
    // </button>;

    return (
        <div>{NXIcon}</div>
    )
}

